script: |
  super -f text -I q11647.spq | sort > q11647.out

inputs:
  - name: q11647.spq
    data: |
      SELECT DISTINCT col0 AS col0, - 90 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT col2 IS NOT NULL AND - 90 NOT IN ( - 35, + col1 - 3 * col1, ( - col2 ) );
  - name: tab2

outputs:
  - name: q11647.out
    data: |
